import { useState } from 'react';
import styles from './Log.module.css';
import LinkButton from '../components/LinkButton';
import Input from '../components/Input';
import Button from '../components/Button';

function Entrar(){
    const [values, setValues] = useState()
    
    const handleChangeValues = (value) => {
        setValues(prevValue => ({
            ...prevValue, 
            [value.target.name]: value.target.value,
        }))
    }
    const submit = (e) => {
        e.preventDefault()
        console.log(values)
    }

    return(
        <section className={styles.section}>
            <h1>Login</h1>
            <form>
                <input text="Insira seu nome de usuário ou email:" type="text" placeholder="Usuário/Email" name="username" onChange={handleChangeValues}/>
                <input text="Insira sua senha:" type="password" placeholder="Senha" name="password" onChange={handleChangeValues}/>
                <button className={stylesBtn.btn} onClick={submit}>Entrar</button>
            </form>
            <span/>
            <LinkButton to="/" text="Voltar"/>
        </section>
    )
}

export default Entrar;
